export const homeObjOne = {
    id:'about',
    lightBg:false,
    lightText:true,
    lightTextDesc:true,
    topLine:'Premium Bank',
    headLine:'Unlimited Transection with zero fees',
    description:'get access to our exclusive app that allows you to send unlimited transection without getting charged any fees',
    buttonLabel:'Get started',
    imgStart:false,
    img: require('../../images/svg-1.svg').default,
    // alt:'Car',
    dark:true,
    primary:true,
    darkText:false
}
export const homeObjTwo = {
    id:'discover',
    lightBg:true,
    lightText:false,
    lightTextDesc:false,
    topLine:'Premium Bank',
    headLine:'Unlimited Transection with zero fees',
    description:'get access to our exclusive app that allows you to send unlimited transection without getting charged any fees',
    buttonLabel:'Learn more',
    imgStart:true,
    img: require('../../images/svg-2.svg').default,
    // alt:'Car',
    dark:false,
    primary:false,
    darkText:true
}

export const homeObjThree = {
    id:'signup',
    lightBg:true,
    lightText:false,
    lightTextDesc:false,
    topLine:'Premium Bank',
    headLine:'Unlimited Transection with zero fees',
    description:'get access to our exclusive app that allows you to send unlimited transection without getting charged any fees',
    buttonLabel:'Start now',
    imgStart:false,
    img: require('../../images/svg-3.svg').default,
    alt:'Car',
    dark:false,
    primary:false,
    darkText:true
}


